import HomePage  from'./pages/HomePage';
import Cart from './pages/Cart';
import { Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<HomePage />} />
        <Route path='cart' element={<Cart />} />

      </Routes>
    </div>
  );
}

export default App;
